import React, {Fragment} from 'react';
import 'react-bulma-components/dist/react-bulma-components.min.css';
import {Button} from 'react-bulma-components';

const App = () => {
    return(
        <Fragment>
            <Button color='primary'> Testando o Bulma </Button>
        </Fragment>
    )
}

export default App;
